package testvector

import "testing"

// Run some KATs through the function to make sure they work.
func TestComputeTestVector(t *testing.T) {
	for _, tc := range []struct {
		KATInput
		name string
	}{
		{
			name: "ML_DSA_44_0",
			KATInput: KATInput{
				Xi:  "f696484048ec21f96cf50a56d0759c448f3779752f0383d37449690694cf7a68",
				RNG: "6dbbc4375136df3b07f7c70e639e223e177e7fd53b161b3f4d57791794f12624",
				PK:  "",
				SK:  "",
				Msg: "20a7b7e10f70496cc38220b944def699",
				SM:  "",
				Ctx: "1c781d9ac91004a4a0502757fec35e4a",
			},
		},
		{
			name: "ML_DSA_65_0",
			KATInput: KATInput{
				Xi:  "f696484048ec21f96cf50a56d0759c448f3779752f0383d37449690694cf7a68",
				RNG: "6dbbc4375136df3b07f7c70e639e223e177e7fd53b161b3f4d57791794f12624",
				PK:  "",
				SK:  "",
				Msg: "20a7b7e10f70496cc38220b944def699",
				SM:  "",
				Ctx: "1c781d9ac91004a4a0502757fec35e4a",
			},
		},
		{
			name: "ML_DSA_87_0",
			KATInput: KATInput{
				Xi:  "f696484048ec21f96cf50a56d0759c448f3779752f0383d37449690694cf7a68",
				RNG: "6dbbc4375136df3b07f7c70e639e223e177e7fd53b161b3f4d57791794f12624",
				PK:  "",
				SK:  "",
				Msg: "20a7b7e10f70496cc38220b944def699",
				SM:  "",
				Ctx: "1c781d9ac91004a4a0502757fec35e4a",
			},
		},
	} {
		t.Run(tc.name, func(t *testing.T) {
			vector, err := ComputeTestVector(tc.KATInput)
			if err != nil {
				t.Fatalf("ComputeTestVector() = %v, want nil", err)
			}
			t.Logf(": %x", vector.Mu)
		})
	}
}
